// Dependecies
import React from 'react';

// Components
import Menu from '../Components/Menu';

function Password(props) {
  return (
    <div className="wrapper">
        <div className="row">
          <Menu/>
        </div>
        <div>Password</div>
    </div>
  );
}
 
export default Password;
